;; @@
(defn daily-total-degree [coll]
  (let [dat {:day (range 61)
             :count (map #(total-degree coll (t/plus (t/date-time 2015 4 1) (t/days %)))                 		
                     (range 61))}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count]]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:geom_point {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Count"]
         [:ggtitle (str coll " daily total degree")])]
      {:width 10 :height 6})))
