;; <=

;; @@
(defn hourly-total-degree [coll]
  (let [dat {:day (range 0 (* 24 61))
             :count (map
                     #(total-degree coll (t/plus (t/date-time 2015 4 1) (t/hours %)))
                     (range 0 (* 24 61)))}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count]]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:xlab "Hour"]
         [:ylab "Count"]
         [:ggtitle (str coll " hourly total degree")])]
      {:width 10 :height 6})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mirthful-shelter/hourly-total-degree</span>","value":"#'mirthful-shelter/hourly-total-degree"}
